    const [data, setData] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
            try {
                const res = axios.get('/api/products')
                setData(res.data)
            } catch (err) {
                throw new Error(err.message)
            }
        }
        fetchData();
    }, []);
